window.onload = function(){
	var num = "";
	var items = [];
	var items_10 = [];
	var c = '';
	var crr = "";
	for(var i=0;i<num.length;i=i+8){
		var item = num.substr(i,8);
		items.push(item);
	}
	for(var i=0;i<items.length;i++){
		var a = parseInt(items[i],2);
		items_10.push(a);
		c = c + String.fromCharCode(a);
	}
	for(var i=0;i<c.length;i=i+4){
		var str_item = c.substr(i,4);
		var int_10_item = parseInt(str_item,16);
		crr+=String.fromCharCode(int_10_item);
	}
	console.log(crr);
}

